import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import { skillInfo } from './Data';

export default function SkillShellDropDown() {
    const [selectedButton, setSelectedButton] = useState("");
    const skillOptions = skillInfo.map(({skill}) => ({ label: skill }));

    const handleButtonClick = (skill) => {
        setSelectedButton(skill);
    };
  return (
    <Autocomplete
    disablePortal
    id="combo-box-demo"
    options={skillOptions}
    sx={{ width: 300 }}
    onChange={() => handleButtonClick(skill.skill)}
    renderInput={(params) => <TextField {...params} label="Choose Skill" />}
  />
  );
}
